Outcomes of life are not governed by passion, they’re governed by principle. ✨ @briannawiest 

A few months back I thought signing up for a new gym would help spark motivation; and it did! But the distance I now had to drive (3x the amount of my previous gym) was enough to mess up my morning routine with getting to the gym before starting work. 

Signing back up for my old gym this week to get 40 min back to my morning and set my routine and environment up for success.  The easier a habit / action is, the more you are likely to do it. I had unknowingly put a barrier between myself and my workouts, and realizing this I removed the barrier. 

Happy training folks 🫶🏼✌🏼✨ 

