✨ SUPERSETS ✨

Main reasons to use supersets:
👉🏼 increase volume on a muscle group and benefit hypertrophy adaptations
👉🏼 increase muscular endurance 
👉🏼 train opposing muscle groups more frequently 
👉🏼 increase muscles full range of motion 
👉🏼 save time! 

I like to incorporate super sets when hitting upper body to increase the load on muscle groups that are more difficult to fatigue (such as biceps and triceps) 

I also like to add in banded movements on lower body days to push the muscle (glutes typically) to failure to really overload the muscle and create that stress which translates into growth. 

