How long should you stretch and when?✨ 

1. Dynamic stretching: best done before a week out and should be done for 5-10 minutes. Perform movements that mimic exercises you’ll be doing in your workout but at a slower pace 
2. Static stretching: involves holding a stretch in a fixed position for a period of time and best done after a workout. Hold heavy stretch for 15-30 seconds. 

Remember to listen to your body! If you feel pain, ease off the stretch. 

