Reverse is not perfect, but this past week was pretty darn close to nailing it on the head with a few small diversions! 

Some things that are helping me stick to my reverse 👇🏼 
• Not buying all the snacks I see at the grocery store that will trigger me. 
• Leaving the kitchen/ living room area after dinner to avoid the urge to snack at night 
• Planning ahead to have meals out/ enjoy treats that fit my macros so I don’t feel restricted and can enjoy meals with friends and family and still hit my nutrition goals. 
• Not putting myself in situations or environments I know I won’t be successful in right now. Key example is a friend had a potluck Friday night that I decided not to attend because I knew it would be more stressful for me. 
• Not stressing about a few BLTs (bites licks tastes) here or there. 
• Continuing to train with intensity and using the extra energy I have to go on longer walks throughout the day; keeping my NEAT high 

My macros have been pretty high right off the bat post show (at roughly 230 carb) so realistically hitting these goals should not be hard and I know the more I adhere, the more flexibility I’ll be able to have come the holidays 🙌🏼 

