1️⃣ Playing “macro Tetris” with my food 🥦 I used to make the most insane concoctions to satisfy my cravings and sweet tooth and neglected whole, unprocessed, nutrient dense foods. This was negatively impacting my energy levels and micronutrient nutrition, and in turn, my physique! 

2️⃣ Neglecting stretching and warming up prior to training 💪 My body has never felt better than the last two years as I’ve focused more on stretching, foam rolling, flexibility and mobility. It has also drastically improved my posing and the pain that comes with that. 

3️⃣ Neglecting posing practice 🕺This one speaks for itself. Your physique CAN be out posed on stage. Practice makes perfect. 

4️⃣ Focusing on post show treats 🍭 🧁 I’ve learned this one the hard way. Grabbing sweets immediately post show spikes your blood sugar and sets you up for failure when it comes to regulating hunger. I no longer bring treats with me and plan it out months ahead of time. I try to stay as unfocused on post show as possible, because the goal is stage, not the treats. The less I focus on that, that more focus I can give to my prep. This also sets me up for success when beginning a reverse. 

Evolving, optimizing, and embracing the journey. Recognizing these things definitely held me back from reaching my full potential as an athlete and am proud of how far I’ve come! 

