Looking at the bigger picture, taking a longer improvement season not only sets me up financially, it sets me up for a more successful competition season in 2025. BodyBUILDING means building muscle. Long offseason = more time spent BUILDING. 

Something I’ve also considered with making this decision 👉🏻 I’ve been really struggling with body image this offseason. And in order for me to re-cultivate that confidence and self love, dieting is not the answer. I think that will only reinforce some negative behaviors and ideals that aren’t conducive to loving my body in its true form. 

Don’t be afraid to step away. The stage will be there, I promise.
Competing is a huge financial commitment and a mental one. Don’t overlook that piece when looking to step on stage. 💯👌🏼

